import React, { Component } from 'react';

export class EmployeeItem extends Component {
  render() {
    return (
      <div>
        {this.employees.map(employee => (
          <div key={employee.id.value}>{employee.name.first}</div>
        ))}
      </div>
    );
  }
}

export default EmployeeItem;
